library(tidyverse)

input &lt;- readLines(con = "../../inputs/2022/02.txt")

guide &lt;- tibble(original = input) |&gt; 
    separate_wider_delim(cols = original,
                         delim = " ",
                         names = c("opponent", "me")) |&gt; 
    mutate(opponent = case_match(opponent,
                                 "A" ~ "Rock",
                                 "B" ~ "Paper",
                                 "C" ~ "Scissors"),
           me       = case_match(me,
                                 "X" ~ "Rock",
                                 "Y" ~ "Paper",
                                 "Z" ~ "Scissors"))

score &lt;- function(opponent, me) {
    if (me == "Rock")
        score &lt;- 1 + case_match(opponent,
                               "Rock"     ~ 3,
                               "Paper"    ~ 0,
                               "Scissors" ~ 6)

    else if (me == "Paper")
        score &lt;- 2 + case_match(opponent, 
                                "Rock"     ~ 6,
                                "Paper"    ~ 3,
                                "Scissors" ~ 0)

    else if (me == "Scissors")
        score &lt;- 3 + case_match(opponent,
                                "Rock"     ~ 0,
                                "Paper"    ~ 6,
                                "Scissors" ~ 3)

    return(score)
}

guide |&gt; 
    mutate(score = map2_int(opponent, me, score)) |&gt; 
    summarise(total = sum(score)) |&gt; 
    pull(total) |&gt; 
    cat()
