library(tidyverse)

commands &lt;- read_delim(file      = "../../inputs/2021/02.txt",
                       col_names = c("direction", "length"))

commands &lt;- commands |&gt; 
    mutate(x = if_else(direction == "forward", 1, 0),
           y = case_match(direction,
                          "down"    ~ 1,
                          "forward" ~ 0,
                          "up"      ~ -1)) |&gt; 
    select(-direction) |&gt; 
    mutate(across(everything(), as.integer)) |&gt;
    mutate(x = x * length,
           y = y * length)

commands |&gt;
    summarise(x = sum(x),
              y = sum(y)) |&gt;
    mutate(product = x * y) |&gt;
    pull(product) |&gt;
    cat()
